import React, { useState } from "react";
import ReactCrop from "react-image-crop";

const Dump = () => {
  const [image, setImage] = useState(null);
  const [crop, setCrop] = useState(null);

  return (
    <div>
      <ReactCrop
        image={image}
        onCropChange={(c) => {
          setCrop(c);
        }}
      />
      <img src={crop} />
    </div>
  );
};

export default Dump;
